import React, { Component } from 'react';

class Sync extends Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div className="sync">
        <ul>
          { this.props.sync && this.props.sync.map(song =>
            <li key={song.id}>{song}</li>
          )}
        </ul>
      </div>
    );
  }
}

export default Sync;
